sample: '["\"As the year of 2018 comes to a gradual close, we all take a time out
  for some reflection.\\nIt is of course at this time of year, that we start to sit
  back and look at what we may have achieved for the previous 11/12 months. Did you
  start that project you wanted to start? Did you hit your financial projections that
  you may have set this time last year?\\nWe all pause for thought at certain stages
  of our life.\\nFor our Betfair trading course, it really has been another great
  year; and in fact more members joined in the last 12 months, than the first 12 months.\\nAll
  good, positive stuff.\\nNow when you launch a successful product, or in this case
  a trading course that many people are talking favourably about, this starts to generate
  some unwanted attention \u2013 which can be amusing sometimes, and it tells you
  a lot about human nature \ud83d\ude42\\nFor example, when we first launched the
  course, we went a full 12 months without a single negative review. And at the time
  of writing, there is still not a \u2018genuine\u2019 negative review about what
  we offer \u2013 but there is a somewhat \u2018dodgy\u2019 review doing the rounds.\\nFake
  Reviews About Our Betfair Scalper Course\\nFor example, when we launched the course,
  and when the attention started to ramp up, we started to get asked by many affiliate
  vendors if we would allow them to promote the course. We offered a very selected
  handful of affiliates the chance to promote our training, but they had to test it
  first.\\nThis then attracted a few, shall we say\u2026 strange applications to become
  an affiliate. Because when you become an affiliate of a product, you of course need
  to see what the product actually details, and what it contains, so affiliates were
  granted access to the course without any payment.\\nSo it goes without saying that
  there were a few \u2018undesirables\u2019 trying to get the course for free \u2013
  which we usually spot a mile off, but one applicant in particular stood out, and
  this is the reason for the one and only negative review on our course \u2013 which
  is fake, by the way.\\nYou can read all about how this strange review came about,
  as the link below will show you how one of our own members spotted the fake \u2018review\u2019,
  gave his own thoughts, and then we explained exactly what happened:\\nThe reason
  for showing you this, apart from being as transparent as we always are, is to show
  you how some people really will go to great lengths to get their hands on a \u2018freebie\u2019
  \u2013 as you will read above, and are then upset when they get found out.\\nThe
  Chancer Who Tried To \u2018Steal\u2019 Our Course as His Own\\nIt was only very
  recently (November, in fact) that we were alerted by another member to somebody
  selling a strangely familar product on eBay, and when we ourselves looked at the
  eBay listing, the sales text was also very, very familiar.\\nWhy? Because the sales
  copy had, word-for-word, been directly copied from our own website.\\nOn completing
  a little investigation (it didn\u2019t take much to be honest!), we quickly found
  that the person selling this eBay product was not only a member of our course, but
  was also using the same stolen sales copy for his own website, which he subsequently
  advertised on his Facebook group.\\nYou couldn\u2019t make it up\u2026\\nOn approaching
  this person, who was obviously committing intellectual property theft, he was adamant
  that this was not the case.\\nNow I am sure the sheer embarrassment of being found
  out caused his defensive stance, but if you watch the content on the following page,
  you will quickly see the evidence to back up our findings:\\nBut that\u2019s the
  internet for you. It seems to have created a certain type of person who feels they
  can just rip off other people\u2019s products, and sell them as their own ideas.\\nWhen
  the reality is, if they actually sat down and thought about it, and placed the same
  effort into creating their own material, then not only would it be unique, but their
  reputation would be greatly enhanced. They then get to the end of their days, after
  hustling, and duping their way through life, and are then left wondering why they
  never really achieved anything worthwhile \u2013 something they could be proud of.\\nIt
  just seems the easier options are far too tempting for some\u2026\\n2018 Was a Successful
  Year For Members\\nAs I mentioned earlier, this year has been great for the course.\\nMembership
  has increased a lot, and we still only have a 0.6% refund rate asked for by members,
  which is almost zero, which continues to consolidate our Betfair course as a very
  attractive investment for those looking to trade the Betfair exchange.\\nWe also
  added a new Questions and Answers section on the sales page, to pre-empt what many
  people were already asking us by email.\\nThe content on the course is now over
  20+ hours long. We don\u2019t advertise this fact, or even check it, but one of
  our more analytical members recently sent an email in claiming that since he last
  logged in, in January this year, that a further 6 hours of content had been added,
  which he was very surprised (and pleased) about.\\nSo yes, we continue to update
  the course, and add new content where we feel it will benefit members \u2013 new
  and old; but these days, most of the content goes directly into the Member Feedback
  section, which is a section we added about 12 months ago which highlights how members
  are getting on with the course \u2013 which also provides some great inspiration.\\nMember
  Profits Continue To Flood In\\nAdditionally, we still continue to receive emails
  from members on an almost daily basis; stating their satisfaction, as well as sending
  in profit and loss screenshots from their trading activities \u2013 all accredited
  to what they have learned from our course.\\nAnd to give you a quick example of
  just a few communications, from email, Facebook and other areas, here are a few
  member discussions from the past few weeks:\\nIn fact, and I have said this a few
  times on the actual course, if I listed and detailed every single recommendation,
  screenshot and feedback we received, most readers (non-course-members) simply would
  not believe it, and when you consider that no other Betfair course receives anywhere
  near the same positive feedback we receive, then you can quickly see why we are
  so very proud of what we offer.\\nIt really is the best feeling you can have when
  you are receiving daily emails from members on the course, detailing how they are
  now making profits, and are, for the first time, excited about what the future will
  bring.\\nNo Barriers to Trading Success \u2013 Only Excuses\\nOur membership database
  has a fair amount of retirees, which is an interesting situation \u2013 because
  they do extremely well.\\nI did consider why this was a few months ago, and it quickly
  became apparent that in this day and age of \u2018instant gratification\u2019 people
  are inclined to have a lack of patience; but where generating an income is concerned
  you definitely need to take your time towards the end goal. This is why our retiree
  members can, and do exceed with Betfair trading, because they have that patience
  \u2013 plus the life experience to understand that real effort and dedication is
  needed for anything worthwhile.\\nWe recently received an email from a 75 year old
  member (John), who after just 2 weeks started live trading only to have 2 x 100%
  successful days. His first 16 trades were all profitable; which not only shows that
  age is no barrier to trading the Betfair markets, but it also shows how by following
  the course structure exactly how it was laid out, that literally anybody could make
  this work for them.\\nJust looking over my email inbox from the last 2 days tells
  me that members are doing very well. Just a few days ago we had yet another member
  writing in to tell us they are soon to be going full time as a Betfair trader, and
  just today another member letting us know about the 95% success rate on trades that
  he is now enjoying.\\n\u2026\u2026\u2026all of which is highlighted in the member
  feedback section of the course.\\nMerry Christmas to All\\nAnd here\u2019s now the
  reason for writing this last blog post of the year, so very close to Christmas.\\nIt\u2019s
  because no matter what goes on in this crazy online, virtual world, the cream will
  always rise to the top; the best products get talked about without even a hint of
  advertising, and the people who play silly games will always play silly games (and
  end up with equally silly prizes).\\nBut\u2026It is what YOU do as an individual
  that decides the direction in your own life, and after the last 12 months how would
  you assess your own progression?\\nIt is a question we all ask ourselves at this
  time of year.\\nIs Christmas going to be a struggle for you this year? Are you having
  to place the bulk of the cost onto a credit card? Are you going to spend the next
  few months paying off the cost of Christmas?\u00c2\\nAs humans most people feel
  they have to partake in the traditions at this time of year, and many also go above
  and beyond in the hope of providing the very best experience for their families
  \u2013 but this comes at a cost that stretches most people.\\nPersonally? Even though
  I could, I have never paid silly money for man-made \u2018traditions\u2019. The
  more financially secure you get in life, the less you feel the \u2018need\u2019
  to promote such wealth to others. I enjoy Christmas, don\u2019t get me wrong, but
  when you read, and hear about people literally blowing thousands of pounds they
  cannot even afford, and on what is basically \u2018crap\u2019, then you have to
  wonder if the priorities are in the right place.\\nAs you get older, and once you
  have made a few quid, you simply stop playing such silly games. In fact, even though
  I could go out right now and purchase the very latest Ferrari, I still drive a 17
  year old BMW. I detail this on my trading journey post.\\nWhen I was growing up,
  Christmas really was a magical time of the year, but that was mainly because there
  was not a lot of money around back in the 70\u2019s, so receiving anything at Christmas
  would fill me with excitement. I vividly remember being given a snooker table for
  Christmas when I was around 12 years, and being extremely grateful. I must have
  used that snooker table for 4/5 years.\\nNow? You have children being given iPhones
  that can cost upwards of \u00a31,000! Times have certainly changed, and the pressure
  to provide at this time of year has become somewhat of a financial epidemic. \u2018Keeping
  up with the joneses\u2019 at your own financial detriment, seems to be a dangerous,
  but accepted way to live in this day and age.\\nMany people find themselves in this
  situation \u2013 which is pure madness.\u00a0If this is your position, and if you
  didn\u2019t achieve all you wanted to, then there is a formula for overcoming that
  for your New Year resolutions:\\nYou simply need to filter through the noise in
  life, and focus on the end goal. Forget what other people are doing, and just concentrate
  on you. It\u2019s not simple, but it really is that easy.\\nMay I take this opportunity
  to wish you all a fantastic Christmas, and all the very best for the 2019 New Year
  ahead.\"", "\"A while back I was asked by an entrepreneur for advice about creating
  an income-generating website. He had no ideas in mind and simply didn\u2019t know
  where to start. After taking some time to think about it, I responded with the following.
  Within a few months he\u2019s already documented a ton of ideas and started executing
  based upon a few of them. Here is my advice on getting started.\\n- Focus on your
  passions\\nIt\u2019s a lot easier to understand what others would be willing to
  pay for or find value in if you focus on an area that you know very well. I see
  that you are interested in personal finance & fitness; two most excellent categories
  that are fairly easy to monetize so long as you provide genuine value.\\n- Source
  your products\\nIf your idea is a physical product that you could sell then get
  to work on finding wholesalers/distributors/dropshippers. If your idea is a virtual
  product (e.g. eBook, etc.), then get to work on creating your first product that
  you can sell.\\n- Leverage your knowledge\\nDiscuss the topic on forums & websites
  that others frequent; discreetly mention your website when it applies and/or add
  it to your signature files.\\n- Marketing is vital\\nOn those marketplaces that
  are highly frequented by your target audience, email the owner of the website and
  ask for sponsorship or advertising opportunities. Be creative and ask if you can
  donate a prize (or prizes) towards a contest they are running; this will finance
  their contest and gain you exposure at little/no cost.\\n- Encourage word of mouth\\nWhen
  you create the website make sure you build it in manner that it encourages sharing
  (share this product, share this article, invite a friend, enter contest & invite
  friends, etc.). Oh and be certain to create an email marketing list. Many people
  think email is dead, it is still one of my best converting sales channels, because
  everyone who subscribes loves the material I publish regularly. Oh and always publish
  regularly, this is important or your momentum dies.\\n- Think outside the box\\nDon\u2019t
  just coast with one or a few products (but don\u2019t defocus yourself too much
  either). The careful balance is that your website should have fresh content and
  products to keep your visitors coming back for more.\\n- Write about your business\\nAs
  you gain speed and traction and know what works, start creating a blog and writing
  about the hottest topics. Every 20-30 blogs or so you\u2019ll hit on a topic that\u2019ll
  gain 10-20x more traffic than the others and every 100 blogs you\u2019ll hit on
  a topic that gains 100x more traffic. First of all, remember these, this is a hot
  product niche you need to hit, and second of all, enjoy the increase in traffic
  and sales.\\n- Be genuine, always\\nDon\u2019t flood your website with ads. Advertisement
  based revenue generation is the worst unless you have tons of traffic (millions
  of hits). Still then, product and/or value monetization will provide returns that
  are exponentially higher.\\nEveryone\u2019s path is unique and no path is linear.
  Your experience may differ from the above recommendations, don\u2019t be afraid
  to explore and experiment. The most important thing is that you execute. If you
  ever find yourself procrastinating or stuck on a specific task put it aside and
  work on your next most important task. When it comes to working for yourself, execution
  is everything. Good luck and may your next entrepreneurial adventure be the shining
  star you were hoping for!\\n\u2013\\nBrent Mondoux\\nCEO, N-VisionIT Interactive\\nbrent@betterwebsites.ca\\nOttawa
