  Roofing Company Savannah Sheds Light on the Lifespan of Roofs: How Long Should a
  Roof Last?\"", "\"STATEN ISLAND, N.Y. -- Native Staten Islander Irene Murphy Hynes,
  93, of Silver Lake, a social worker who had a passion for singing, died Tuesday
  in Carmel Richmond Healthcare and Rehabilitation Center, Dongan Hills.\\nBorn Irene
  Murphy in New Brighton, she settled in Silver Lake around 1923.\\nA graduate of
  St. Peter''s Girls High School, New Brighton, she earned her master''s degree from
  Fordham University in the Bronx.\\nHer career as a social worker began at the former
  Staten Island Hospital in New Brighton. She later worked at the Brooklyn Veterans
  Hospital, retiring in 2000.\\nHer lifelong affection toward classical and opera
  music eventually led her to sing with St. Cecilia, the sorority for musical women
  on Staten Island. She was also a member of Soroptimist International of the Americas,
  the Business and Professional Women''s Foundation and St. Peter''s Girls Alumnae
  Association.\\nAbove all, Mrs. Hynes enjoyed being with her family, and especially
  cherished summers spent with relatives at her lake house.\\n\\\"Her family loved
  her and will miss her very much,\\\" said her nephew, John Murphy.\\nHer husband
  of 32 years, Francis Hynes, died in 2002.\\nSurviving are two stepsons, Timothy
  Hynes and Richard Hynes, and a stepdaughter, Diane Hynes.\\nThe funeral will be
  Saturday from the Harmon Home for Funerals, West Brighton, with a mass at 10 a.m.
  in St. Peter''s R.C. Church, New Brighton. Burial will follow at St. Peter''s Cemetery,
